import React from "react";
import { Nav, NavLink, NavMenu }
  from "./NavbarElements";
import './src/Navbar.css'
const Navbar = () => {
  return (
    <>
      <Nav>
        <NavMenu className="nav-menue">
          <NavLink to="/index" activeStyle>
            Startseite
          </NavLink>
          <NavLink to="/about" activeStyle>
            About
          </NavLink>
        </NavMenu>
      </Nav>
    </>
  );
};

export default Navbar;
